import React from "react";
import '../assets/App.css';
import Header from "./Header"
import HeroSelection from "./HeroSelection"
import RecruitList from "./RecruitList"
import Team from "./Team"


function App() {
  return (
    <div >

      <Header />

      <HeroSelection />

      <RecruitList />

      <Team />

    </div>
  );
}

export default App;
